import React from "react";
import Navbarprofile from "../../Components/Navbarprofile/Navbarprofile";
import Navprofile from "../../Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { blue } from "@mui/material/colors";
import { useState } from "react";
//import "./Profile.css";
import Tabpanell from "../../Components/Tabpanel/Tabpanell";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
  MDBCardText,
} from "mdb-react-ui-kit";
import { Grid } from "@mui/material";
const Profile = () => {
  return (
    <div
      style={{
        // backgroundColor: "red",
        display: "flex",
        justifyItems: "column",
        width: "196vh",
      }}
    >
      <div
        style={{
          // backgroundColor: "yellow",
          display: "inline-block",
          position: "sticky",
          top: 0,
          height: "100%",
          //position: "fixed",
        }}
      >
        <Navprofile />
      </div>

      <div
        style={{
          // backgroundColor: "green",
          width: "185vh",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          //alignItems: "center",
          // height: "500px",
        }}
      >
        <div
          style={{
            // backgroundColor: "blue",
            height: "65px",
            //position: "fixed",
            top: 0,
            //left: 0,
            right: 0,
            position: "sticky",
            width: "100%",
            zIndex: 2,
            //position: "fixed",
          }}
        >
          <Navbarprofile />
        </div>
        <div
          style={{
            zIndex: "0",
            // backgroundColor: "orange",
            display: "inline-block",

            // marginTop: "64px",
            // zIndex: "0",
            // height: "65px",
            // width: "1600px",
            //position: "fixed",
          }}
        >
          <MDBContainer className="py-5 h-100">
            <MDBRow className="justify-content-center align-items-center h-100">
              <MDBCol xl="12" lg="10" md="10" sm="10" xs="8">
                <MDBCard>
                  <div
                    className="rounded-top text-white d-flex flex-row"
                    style={{
                      //backgroundColor: "#000",
                      height: "300px",
                    }}
                  >
                    <div
                      className="ms-4 mt-5 "
                      style={{
                        width: "150px",
                        marginLeft: "20px",
                        //marginRight: "0px",
                        //backgroundColor: "green",
                        height: "200px",
                        display: "flex",
                        flexDirection: "column",
                        //alignContent: "center",
                        //alignItems: "center",
                        //justifyContent: "space-between",
                      }}
                    >
                      <MDBCardImage
                        src="https://i.pinimg.com/564x/e1/be/95/e1be95e26e853c491ff3a09e6b996783.jpg"
                        alt="Generic placeholder image"
                        className="img-thumbnail"
                        fluid
                        style={{ width: "150px", zIndex: "0" }}
                      />

                      <div
                        style={{
                          marginTop: "10px",
                          //backgroundColor: "red",
                          display: "flex",
                          // justifyContent: "row",
                          // alignContent: "center",
                          marginRight: "0px",
                          //margin: "0px",
                          width: "150px",
                          padding: "0px",
                        }}
                      >
                        <MDBBtn
                          className="mx-2"
                          color="light"
                          rippleColor="dark"
                          style={{
                            height: "28px",
                            width: "135px",
                            fontSize: "18px",
                            // position: "fixed",
                            padding: "0px",
                            margin: "0px",
                            // zIndex: "0",
                            //textAlign: " right;",
                          }}
                        >
                          <div>Edit profile</div>
                        </MDBBtn>
                      </div>
                    </div>

                    <Grid
                      container
                      spacing={1}
                      //className="ms-3"
                      style={{
                        marginTop: "50px",
                        marginLeft: "50px",
                        //backgroundColor: "red",
                        display: "flex",

                        height: "180px",
                      }}
                    >
                      <Grid
                        xs={10}
                        sx={{
                          // backgroundColor: "green",
                          height: "40px",
                        }}
                      >
                        <MDBTypography
                          tag="div" // wrap the <p> elements in a <div> container
                          style={{
                            display: "flex", // use flexbox to align the <p> elements horizontally
                            margin: "0px",
                            flexDirection: "column", // vertically center the <p> elements
                            marginRight: "45px",
                            color: "#2D033B",
                            fontSize: "13px",
                          }}
                        >
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally

                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",
                                color: "#2D033B",
                                fontSize: "10px",
                                marginRight: "10px",
                                margin: "0px",
                              }}
                            >
                              HOME ADRESS:
                            </p>
                            <p
                              style={{
                                color: "black",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              {localStorage.getItem("homeAddress")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              marginRight: "10px",
                              margin: "0px",
                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",

                                color: "#2D033B",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              PHONE NUMBER:
                            </p>
                            <p
                              style={{
                                color: "black",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              {localStorage.getItem("phone")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              backgroundColor: "green",
                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",
                                //color: "#2D033B",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              AVERAGE RESPONSE TIME:
                            </p>
                            <p
                              style={{
                                color: "black",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              {localStorage.getItem("avgResponseTime")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              // backgroundColor: "red",
                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",
                                color: "#2D033B",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              DESCRIPTION:
                            </p>
                            <p
                              style={{
                                color: "black",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              {localStorage.getItem("description")}
                            </p>
                          </div>
                        </MDBTypography>
                      </Grid>
                    </Grid>
                  </div>
                  <MDBCardBody
                    style={{
                      backgroundColor: "red",
                      margin: "0px",
                      padding: "0px",
                    }}
                  >
                    <Tabpanell />
                  </MDBCardBody>
                </MDBCard>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </div>
      </div>
    </div>
  );
};
export default Profile;
